import React from 'react'
import {NavLink} from 'react-router-dom'
import './navbar.css'

const Navbar = () => {
  return (
    <div><ul>
    <NavLink classNto='/' className="active" >Home</NavLink>
    <NavLink to='/' className="active" >Home</NavLink>
  </ul></div>
  )
}

export default Navbar
